import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import '../components/HomeComponent.css';

function Contact() {
  return (
    <div>
      <div className="service__bg">
        <h1 className="service__title">Contact</h1>
      </div>
      <Container>
        <Row>
          <Col xs={6}>
            <div className="contact__info">
              <h2 className="contact__title">Phone Number</h2>
              <p className="contact__info">+91 (934) 166-6667</p>
            </div>
          </Col>
          <Col xs={6}>
          
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Contact;
